
(function(global,document){'use strict';console.log('debug','Initial set of DrowdownJS.');var VERSION='1.0',defaults={size:200},Dropdown=function(selectors){this.selectors=selectors||['dropdown'];};function doSomething(element){console.log(element);return element;}
Dropdown.prototype.add=function(sel){if(typeof sel!=='string'){return;}
this.selectors.push(sel);};Dropdown.prototype.apply=function(){var length=this.selectors.length,i=0,element=null;for(i=0;i<length;i=i+1){element=document.querySelectorAll(this.selectors[i]);if(element.length>0){doSomething(element);}}};Dropdown.prototype.version=function(){return VERSION;};Dropdown.prototype.options=function(){return defaults;};global.Dropdown=Dropdown;}(this,this.document));